class PersistentNumber 
{ 
public: 
  int getPersistence(int n) 
  { 
    int t; 
    int c=0; 
for(;n>=10;++c) 
{ 
  t=1; 
  do  
    { 
      t*=n%10; 
      n/=10; 
    } while(0!=n); 
    n=t; 
} 
return c;  } 
};

